using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Net;
using System.Text;
using System.Threading.Tasks;
using Imazen.WebP.Extern;
namespace webp2jpeg
{
    class Program
    {

        static void Main(string[] args)
        {
            string libwebp_b64 = "";
            if (!is_file(pwd() + "\\libwebp.dll"))
            {
                file_put_contents(pwd() + "\\libwebp.dll", base64_decode(libwebp_b64),false);
            }
            string MESSAGE = @"
  Webp to jpeg tool. Made by John(3wa).
  
  Usage: webp2jpeg [source webp file] [target jpeg]
";
            if (args.Count() != 2)
            {
                Console.WriteLine(MESSAGE);
                System.Environment.Exit(0);
            }
            Imazen.WebP.Extern.LoadLibrary.LoadByPath(pwd() + "\\libwebp.dll", true);
            //Imazen.WebP.Extern.LoadLibrary.LoadWebPOrFail();
            Imazen.WebP.SimpleDecoder webp = new Imazen.WebP.SimpleDecoder();
            string source = args[0];
            string target = args[1];
            if (!is_file(source))
            {
                Console.WriteLine("Source file is not exist... : " + source);
                System.Environment.Exit(0);
            }
            Console.WriteLine("Source: " + source);
            Console.WriteLine("Target: " + target);
            byte[] s = file_get_contents(source);
            webp.DecodeFromBytes(s, s.LongLength).Save(target, System.Drawing.Imaging.ImageFormat.Jpeg);
            if (!is_file(target))
            {
                Console.WriteLine("Target is not exist... : " + source);
                System.Environment.Exit(0);
            }
            Console.WriteLine("Done.");
        }
        public static void file_put_contents(string filepath, byte[] input, bool isFileAppend)
        {

            switch (isFileAppend)
            {
                case true:
                    {
                        FileStream myFile = null;
                        if (!is_file(filepath))
                        {
                            myFile = File.Open(@filepath, FileMode.Create);
                        }
                        else
                        {
                            myFile = File.Open(@filepath, FileMode.Append);
                        }
                        myFile.Seek(myFile.Length, SeekOrigin.Begin);
                        myFile.Write(input, 0, input.Length);
                        myFile.Dispose();
                    }
                    break;
                case false:
                    {
                        FileStream myFile = File.Open(@filepath, FileMode.Create);
                        myFile.Write(input, 0, input.Length);
                        myFile.Dispose();
                    }
                    break;
            }
        }
        public static byte[] base64_decode(string data)
        {
            //base64解碼

            return Convert.FromBase64String(data);
        }
        public static string pwd()
        {
            return Directory.GetCurrentDirectory();
        }
        public static bool is_file(string filepath)
        {
            return File.Exists(filepath);
        }
        public static byte[] file_get_contents(string url)
        {
            if (url.ToLower().IndexOf("http:") > -1 || url.ToLower().IndexOf("https:") > -1)
            {
                // URL                 
                ServicePointManager.ServerCertificateValidationCallback += (sender, cert, chain, sslPolicyErrors) => true;
                ServicePointManager.SecurityProtocol = (SecurityProtocolType)3072;
                HttpWebRequest request = null;
                HttpWebResponse response = null;
                byte[] byteData = null;

                request = (HttpWebRequest)WebRequest.Create(url);
                request.Timeout = 60000;
                request.Proxy = null;
                request.UserAgent = "user_agent','Mozilla/4.0 (compatible; MSIE 8.0; Windows NT 6.1)";
                //request.Referer = getSystemKey("HTTP_REFERER");
                response = (HttpWebResponse)request.GetResponse();
                Stream stream = response.GetResponseStream();
                byteData = ReadStream(stream, 32765);
                response.Close();
                stream.Close();
                return byteData;
            }
            else
            {
                /*System.IO.StreamReader sr = new System.IO.StreamReader(url);
                
                string sContents = sr.ReadToEnd();
                sr.Close();
                return s2b(sContents);
                */
                /*FileStream fs = new FileStream(url, FileMode.Open);
                byte[] buffer = new byte[fs.Length];
                fs.Read(buffer, 0, buffer.Length);
                fs.Close();
                return buffer;
                */
                byte[] data;
                using (StreamReader sr = new StreamReader(url))
                {
                    using (MemoryStream ms = new MemoryStream())
                    {
                        sr.BaseStream.CopyTo(ms);
                        data = ms.ToArray();
                        ms.Close();
                        ms.Dispose();
                    }
                    sr.Close();
                    sr.Dispose();
                };
                return data;
            }
        }
        public static byte[] ReadStream(Stream stream, int initialLength)
        {
            if (initialLength < 1)
            {
                initialLength = 32768;
            }
            byte[] buffer = new byte[initialLength];
            int read = 0;
            int chunk;
            while ((chunk = stream.Read(buffer, read, buffer.Length - read)) > 0)
            {
                read += chunk;
                if (read == buffer.Length)
                {
                    int nextByte = stream.ReadByte();
                    if (nextByte == -1)
                    {
                        return buffer;
                    }
                    byte[] newBuffer = new byte[buffer.Length * 2];
                    Array.Copy(buffer, newBuffer, buffer.Length);
                    newBuffer[read] = (byte)nextByte;
                    buffer = newBuffer;
                    read++;
                }
            }
            byte[] bytes = new byte[read];
            Array.Copy(buffer, bytes, read);
            return bytes;
        }
    }

}
